import React, { useState, useEffect, useContext, useRef } from 'react'
import { AppContext } from '../App';
import { Link } from "react-router-dom"

function Address() {
    const { address } = useContext(AppContext)
    const [addressForShow, setAddressForShow] = useState({})

    useEffect(() => {
        setAddressForShow(address)
    }, [])

    return (
        <div>
            <div className="list-group">
                {addressForShow.street ?
                    <ul className="list-group list-group-flush">
                        <li className="list-group-item">Street      :       {addressForShow.street}</li>
                        <li className="list-group-item">Suite       :       {addressForShow.suite}</li>
                        <li className="list-group-item">City        :       {addressForShow.city}</li>
                        <li className="list-group-item">Zipcode     :       {addressForShow.zipcode}</li>
                        <li className="list-group-item">Geo         : </li>
                        <li className="list-group-item">Lat         :       {addressForShow.geo.lat}</li>
                        <li className="list-group-item">lng         :       {addressForShow.geo.lng}</li>
                        <li className="list-group-item"><Link to='/'>Go Back</Link></li>
                    </ul>
                    :
                    <ul className="list-group list-group-flush">
                        <li className="list-group-item">No Data</li>
                        <li className="list-group-item"><Link to='/'>Go Back</Link></li>
                    </ul>}
            </div>
        </div>
    )
}

export default Address;
